import axios from "axios";
import { useEffect } from "react";

const userProfile=()=>{

    const [data,setData]=useState();
    useEffect(()=>{
        const fetch=()=>{
            axios.get("http://localhost:4000/api/auth/user",{
                headers:{
                    Authorization:`Bearer ${localStorage.getItem("token")}`
                }
            }).then((res)=>{
                console.log(res.data)
            })
        }
        fetch();
    })
    return(
        <>

        </>
    )
}
